        <input placeholder="" type="text" />
      </div>
      <div className="lsItem">
        <label>Check-in Date</label>
        <span>dd/mm/yyyy</span>
        {/* <DateRange
                  onChange={(item) => setDate([item.selection])}
                  minDate={new Date()}
                  ranges={date}
                /> */}
      </div>
    </div>
  );
};
